hực tế sẽ như vậy \nỞ nơi đó thời gian như ngừng trôi, hỡi em \n\n1 phút đứng trước mặt em, 1 phút nói ra lời chưa nói \n1 phút mạnh mẽ từ anh, ta vẫn sẽ chung lối đi \nAnh chẳng thể nào quay lại, để bây giờ chẳng nói giá như \nGiá như em hiểu rằng, giá như em 1 lần nhìn được, từ ánh mắt anh ! \n\nVì trái tim anh cần em, vì với anh em là duy nhất \nThế nhưng bây giờ đây, chẳng thể đến được với nhau \nAnh đã sai thật rồi, anh sai thật rồi \nVì cứ mãi giữ lời yêu em trong trái tim\n\n————————————\n☞ SUBSCRIBE Youtube Andiez:  "},{"text":"http://bit.ly/andiezofficial","navigationEndpoint":{"clickTrackingParams":"CNQCEM2rARgBIhMIxI6vke-Q-AIVPE0PAh0PoQ-xSJyp_Yiq3IfadA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmNTTjU3MFlqMVlXNE5ieGRQRzIxekIzdjdGZ3xBQ3Jtc0tsVTNkQXVPdFN2NHFoVWhDcEl3VURnajVvWFkzSnR0QU51LThjY050R3pJTXBjaUc4NFRkQndZT1RnbHRQdlAxY01zLWg5UXJfNlRHTFZPS3FCV3ZZNjRYbFZrUlh4T1FmSXZQRWpYX3hrcERrWDFXcw\u0026q=http%3A%2F%2Fbit.ly%2Fandiezofficial\u0026v=dLQe4qEfVJw","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbmNTTjU3MFlqMVlXNE5ieGRQRzIxekIzdjdGZ3xBQ3Jtc0tsVTNkQXVPdFN2NHFoVWhDcEl3VURnajVvWFkzSnR0QU51LThjY050R3pJTXBjaUc4NFRkQndZT1RnbHRQdlAxY01zLWg5UXJfNlRHTFZPS3FCV3ZZNjRYbFZrUlh4T1FmSXZQRWpYX3hrcERrWDFXcw\u0026q=http%3A%2F%2Fbit.ly%2Fandiezofficial\u0026v=dLQe4qEfVJw","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n————————————\n\nMore about Andiez\n☞ Fanpage: "},{"text":"https://www.facebook.com/andiezmusic/","navigationEndpoint":{"clickTrackingParams":"CNQCEM2rARgBIhMIxI6vke-Q-AIVPE0PAh0PoQ-xSJyp_Yiq3IfadA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbEp0Ym9fNFo2OTB2UEpZOWl1OWpDNGIxSU9uZ3xBQ3Jtc0tsNXlNeTRaRE1YZldBTF95UnNoa3NoSnJGc2k0WTd3SXFCSnhxWHBVZEZvVkZkNUVYRHA5LVZSS
